import styles from './styles.module.css';

const Main = () => {
    const handleLogout = () => {
        localStorage.removeItem("token");
        window.location.reload();
    };

    return (
        <div classname={styles.main_container}>
            <h1>FocusFish <button className={styles.white_btn} onClick={handleLogout}>
                    Logout
                </button>
            </h1>
        
        </div>
    )
}

export default Main;
